Here's a Swift class that stacks two images and scales them to a specific size:

```swift
import UIKit

class StackedImagesView: UIView {
    private var iconScale: CGFloat = 0.7
    private var image1: UIImage?
    private var image2: UIImage?

    init(image1: UIImage, image2: UIImage, iconScale: CGFloat = 0.7) {
        self.image1 = image1
        self.image2 = image2
        self.iconScale = iconScale
        super.init(frame: .zero)
        setupLayers()
    }

    required init?(coder: NSCoder) {
        fatalError("init(coder:) has not been implemented")
    }

    private func setupLayers() {
        let image1Layer = CALayer()
        let image2Layer = CALayer()

        image1Layer.contents = image1?.cgImage
        image2Layer.contents = image2?.cgImage

        layer.addSublayer(image1Layer)
        layer.addSublayer(image2Layer)

        updateLayers()
    }

    override func layoutSubviews() {
        super.layoutSubviews()
        updateLayers()
    }

    private func updateLayers() {
        guard let image1 = image1, let image2 = image2 else { return }

        let newWidth = bounds.width
        let iconsSize = floor(newWidth * iconScale)
        let iconsInset = (newWidth - iconsSize) - 1

        let image1Frame = CGRect(x: iconsInset, y: 0, width: iconsSize, height: iconsSize)
        let image2Frame = CGRect(x: 0, y: iconsInset, width: iconsSize, height: iconsSize)

        layer.sublayers?[0].frame = image1Frame
        layer.sublayers?[1].frame = image2Frame
    }
}
