Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.ListBuffer

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[(String, Long)] = spark.sparkContext.parallelize(List(
      ("query1", 1614564000),
      ("query2", 1614564001),
      ("query1", 1614564002),
      ("query3", 1614564003),
      ("query2", 1614564004),
      ("query1", 1614564005),
      ("query4", 1614564006),
      ("query2", 1614564007),
      ("query3", 1614564008),
      ("query1", 1614564009),
      ("query2", 1614564010)
    )).map(x => (x._1, x._2 * 1000)) // Convert timestamp to milliseconds

    // Load top frequent queries
    val topQueries: List[String] = List("query1", "query2", "query3")
    val topQueriesBroadcast: Broadcast[List[String]] = spark.sparkContext.broadcast(topQueries)

    // Calculate hit rate
    val hitRate = calculateHitRate(onsiteData, topQueriesBroadcast)
    println(s"Hit rate: $hitRate")

    spark.stop()
  }

  def calculateHitRate(onsiteData: JavaRDD[(String, Long)], topQueriesBroadcast: Broadcast[List[String]]): Double = {
    val cache = mutable.Map[String, (Long, Boolean)]()
    val cacheMisses = new ListBuffer[String]()

    // Process onsite data
    onsiteData.foreach(record => {
      val query = record._1
      val timestamp = record._2

      // Check if query is in top queries
      if (topQueriesBroadcast.value.contains(query)) {
        // Check if query is in cache
        if (cache.contains(query)) {
          val (cachedTimestamp, isCached) = cache(query)
          // Check if query is still cached
          if (isCached && timestamp - cachedTimestamp <= 12 * 60 * 60 * 1000) {
            // Cache hit
          } else {
            // Cache miss
            cacheMisses += query
            cache.put(query, (timestamp, true))
          }
        } else {
          // Cache miss
          cacheMisses += query
          cache.put(query, (timestamp, true))
        }
      }
    })

    // Calculate hit rate
    val totalQueries = onsiteData.count()
    val totalCacheMisses = cacheMisses.distinct.size
    val hitRate = 1.0 - (totalCacheMisses.toDouble / totalQueries.toDouble)
    hitRate
  }
}
```
This job first loads the onsite attributed data and top frequent queries. It then calculates the hit rate by iterating through the onsite data and checking if each query is in the top frequent queries and if it is in the cache. If the query is not in the cache, it is considered a cache miss and the query is added to the cache. The hit rate is then calculated as the number of cache hits divided by the total number of queries.

