```jsx
import React, { useState } from 'react';
import { useMutation } from '@apollo/client';
import { ADD_DATA } from './mutations';

const MyForm = () => {
  const [formState, setFormState] = useState({
    input1: '',
    input2: '',
    input3: '',
  });

  const [addData, { data, loading, error }] = useMutation(ADD_DATA);

  const onSubmit = async (event) => {
    event.preventDefault();

    try {
      const { data } = await addData({
        variables: {
          input1: formState.input1,
          input2: formState.input2,
          input3: formState.input3,
        },
      });

      console.log('Data added successfully:', data);
      // Handle successful data submission here
    } catch (error) {
      console.error('Error adding data:', error);
      // Handle error here
    }
  };

  const onChange = (event) => {
    setFormState({
      ...formState,
      [event.target.name]: event.target.value,
    });
  };

  return (
    <form onSubmit={onSubmit}>
      <input
        type="text"
        name="input1"
        value={formState.input1}
        onChange={onChange}
      />
      <input
        type="text"
        name="input2"
        value={formState.input2}
        onChange={onChange}
      />
      <input
        type="text"
        name="input3"
        value={formState.input3}
        onChange={onChange}
      />
      <button type="submit">Submit</button>
    </form>
  );
};

export default MyForm;
```
