To make the code run only once every 0.6 seconds, you can use a debouncing technique. Debouncing is a technique that ensures that a function is not called again until a certain amount of time has passed without it being called.

Here's how you can modify the code to use debouncing:

1. First, create a debounce function. This function will take in a function and a delay time as arguments and return a new function that will only call the original function once every delay time.
```javascript
const debounce = (func, delay) => {
  let debounceTimer;
  return function() {
    const context = this;
    const args = arguments;
    clearTimeout(debounceTimer);
    debounceTimer = setTimeout(() => func.apply(context, args), delay);
  }
}
```
2. Next, create a new function that wraps the code inside the useEffect hook. This function will be passed to the debounce function.
```javascript
const updatePortfolio = () => {
  tl.set($portfolioNext.current,{
    clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
  });
  tl.set($portfolioNext.current,{
    css:{backgroundImage:'url('+cursor.cursorImage+')'},
  });

  tl.to($portfolioCurrent.current,{
    clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
    duration:.5,
  },'start');

  tl.to($portfolioNext.current,{
    clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
    delay:.1,
    duration:.5,
  },'start');

  tl.set($portfolioCurrent.current,{
    clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
  });

  tl.set($portfolioCurrent.current,{
    css:{backgroundImage:'url('+cursor.cursorImage+')'},
  });
}
```
3. Finally, pass the debounced function to the useEffect hook.
```javascript
useEffect(() => {
  const debouncedUpdatePortfolio = debounce(updatePortfolio, 600);
  debouncedUpdatePortfolio();
}, [cursor.cursorImage]);
```
Now, the code inside the useEffect hook will only run once every 0.6 seconds, even if the cursor.cursorImage dependency changes more frequently than that.

