Here are the JavaScript functions to pack and unpack an array of entities to an ArrayBuffer:

```javascript
function packEntities(entities) {
  const buffer = new ArrayBuffer(entities.length * 1);
  const view = new DataView(buffer);

  entities.forEach((entity, index) => {
    const byte = (entity.id << 3) | (entity.size & 0x07);
    view.setUint8(index, byte);
  });

  return buffer;
}

function unpackEntities(buffer) {
  const view = new DataView(buffer);
  const entities = [];

  for (let i = 0; i < view.byteLength; i++) {
    const byte = view.getUint8(i);
    const id = (byte >> 3) & 0x0F;
    const size = byte & 0x07;
    entities.push({ id, size });
  }

  return entities;
}
```

These functions assume that the `entities` array is an array of objects with `id` and `size` properties. The `packEntities` function creates an ArrayBuffer with a size of `entities.length * 1` bytes, as each entity is packed into a single byte. It then iterates through the entities, packing each one into a byte by shifting the `id` 3 bits to the left and bitwise OR-ing it with the `size`. The resulting byte is then written to the ArrayBuffer using the DataView's `setUint8` method.

The `unpackEntities` function does the reverse. It creates a new DataView from the ArrayBuffer and then iterates through each byte in the buffer. For each byte, it extracts the `id` and `size` by shifting the byte 3 bits to the right and bitwise AND-ing it with 0x0F for the `id`, and bitwise AND-ing it with 0x07 for the `size`. The resulting `id` and `size` are then used to create a new entity object, which is added to the `entities` array.

